  const [userData, setUserData] = useState()
 const getUserData = async ()=>{
  try {
    const response =await fetch('https://thapatechnical.github.io/userapi/users.json')
    const Data = response.json()
    setUserData(Data)
  } catch (error) {
    console.log('Api Data Error' , error )
  }
 }
useEffect(() => {
 
 getUserData()
